	/**
	 * Constructs a new PTBLexer with a custom LexedTokenFactory.
	 * 
	 * @param r
	 *            The Reader to tokenize text from
	 * @param tf
	 *            The LexedTokenFactory that will be invoked to convert each
	 *            substring extracted by the lexer into some kind of Object (
	 *            such as a Word).
	 */
	public PTBLexer(Reader r, FeatureLabelTokenFactory tf, boolean tokenizeCRs) {
		this(r, tf, tokenizeCRs, false);
	}

	/**
	 * Constructs a new PTBLexer which suppresses PTB token transforms (like
	 * -LRB-, -RRB-).
	 * 
	 * @param suppressEscaping
	 *            if true, suppress the PTB token transform and keep the
	 *            original ones
	 */
	public PTBLexer(Reader r, FeatureLabelTokenFactory tf, boolean tokenizeCRs,
			boolean suppressEscaping) {
		this(r);
		this.invertable = false;
		tokenFactory = tf;
		this.tokenizeCRs = tokenizeCRs;
		// System.err.println("DEBUG: suppressEscaping="+suppressEscaping);
		this.suppressEscaping = suppressEscaping;
	}

	/**
	 * Constructs a new PTBLexer which produces FeatureLabels.
	 * 
	 * @param r
	 *            The Reader to tokenize text from
	 * @param invertable
	 *            If the invertable flag is set to true then the produced
	 *            FeatureLabels will contain fields for the text both before and
	 *            after the current token (but after the previous token and
	 *            before the next token) and the original version of this word,
	 *            and the character offset for when the token begins and ends.
	 *            In this case the tokenFactory necessarily vends FeatureLabels.
	 */
	public PTBLexer(Reader r, boolean invertable, boolean tokenizeCRs) {
		this(r);
		tokenFactory = new FeatureLabelTokenFactory();
		this.invertable = invertable;
		this.tokenizeCRs = tokenizeCRs;
		// System.err.println("invertable2: "+this.invertable);
	}

